import { createCssAttributesSelector } from '../utils/createCssAttributesSelector'
const absolutionizeNodes = (parent, convertableAttrs = []) => {
  try {
    const attrSelector = createCssAttributesSelector(convertableAttrs)
    const nodesWithSrc = parent.querySelectorAll(attrSelector)
    const basePath = parent.getAttribute('data-base-path')
    if (!basePath || basePath.length <= 0) throw new Error('Base path not defined')
    nodesWithSrc.forEach((node) => {
      const srcValue = node.getAttribute('src')
      const absolutionedUrl = new URL(srcValue, basePath)
      node.setAttribute('src', absolutionedUrl)
    })
  } catch (err) {
    console.error('Could not absolutionize resources', err)
  }
}
export class AbsolutionBase extends HTMLElement {
  constructor () {
    super()
    const domContentLoadedListener = (event) => {
      absolutionizeNodes(this, ['src'])
      window.removeEventListener('DOMContentLoaded', domContentLoadedListener)
    }
    window.addEventListener('DOMContentLoaded', domContentLoadedListener)
  }
}
